  const [visible, setVisible] = useState(false)
  const [fill, setFill] = useState("#ffffff")
  const containerRef = useRef<HTMLDivElement | null>(null)

  useEffect(() => {
    setMounted(true)
    const timer = setTimeout(() => setVisible(true), 100)
    return () => clearTimeout(timer)
  }, [])

